import React, { Component, Fragment } from 'react';
import Navbar from '../../UI/Navbar';

import './DAOffice.css';

class MeetYourDA extends Component {
    render () {
        return (
            <Fragment>
                <div className="home-wrapper">
                    <Navbar></Navbar>
                    <div className="container">
                        <div className="content-wrapper">
                            <h5>Joyce E. Dudley</h5>
                            <h6 className="mt-4">Santa Barbara County District Attorney</h6>
                            <p className="mt-4">Joyce E. Dudley was elected District Attorney of Santa Barbara County in June 2010 and assumed office on June 22, 2010. District Attorney Dudley is dedicated to fulfilling the primary function of the District Attorney’s Office, which is to seek justice for all.</p>
                            <p className="mt-4">District Attorney Dudley has followed through on her commitment to the voters of Santa Barbara County by bringing transparency, improved communication and innovation to the District Attorney’s Office. Since taking office, she has instituted a number of positive changes.</p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                            <p className="mt-4"></p>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default MeetYourDA;
